import React from 'react';
import ProductCard from './ProductCard';
import './ProductList.css';

const ProductList = ({ searchTerm }) => {
  const products = [
    { id: 1, name: 'Vintage Camera', description: 'Classic film camera.', image: 'https://via.placeholder.com/300x200', price: 149.99, rating: 4 },
    { id: 2, name: 'Wireless Headphones', description: 'Noise-cancelling headphones.', image: 'https://via.placeholder.com/300x200', price: 299.99, rating: 5 },
    { id: 3, name: 'Fresh Apricot', description: 'Juicy apricot.', image: 'https://thumbs.dreamstime.com/b/isolated-apricot-whole-single-fruit-leaf-white-background-fresh-closeup-217057750.jpg', price: 1.49, rating: 4 },
    { id: 4, name: 'Smartphone', description: 'Latest model smartphone.', image: 'https://via.placeholder.com/300x200', price: 999.99, rating: 5 },
    { id: 5, name: 'Laptop', description: 'High-performance laptop.', image: 'https://via.placeholder.com/300x200', price: 1299.99, rating: 4 },
    { id: 6, name: 'Bluetooth Speaker', description: 'Portable speaker with rich sound.', image: 'https://via.placeholder.com/300x200', price: 49.99, rating: 3 },
    { id: 7, name: 'Smartwatch', description: 'Wearable tech with health tracking.', image: 'https://via.placeholder.com/300x200', price: 199.99, rating: 4 },
    { id: 8, name: 'Action Camera', description: 'Capture your adventures.', image: 'https://via.placeholder.com/300x200', price: 299.99, rating: 5 },
    { id: 9, name: 'Gaming Console', description: 'Next-gen gaming.', image: 'https://via.placeholder.com/300x200', price: 499.99, rating: 5 },
    { id: 10, name: '4K TV', description: 'Ultra HD TV with vibrant colors.', image: 'https://via.placeholder.com/300x200', price: 799.99, rating: 4 },
    { id: 11, name: 'Electric Toothbrush', description: 'Maintain oral hygiene.', image: 'https://via.placeholder.com/300x200', price: 29.99, rating: 3 },
    { id: 12, name: 'Running Shoes', description: 'Comfortable shoes for athletes.', image: 'https://via.placeholder.com/300x200', price: 89.99, rating: 4 },
    { id: 13, name: 'Blender', description: 'Smoothies and shakes in seconds.', image: 'https://via.placeholder.com/300x200', price: 39.99, rating: 4 },
    { id: 14, name: 'Digital SLR Camera', description: 'Professional-grade photography.', image: 'https://via.placeholder.com/300x200', price: 1499.99, rating: 5 },
    { id: 15, name: 'Noise Cancelling Earbuds', description: 'Immersive sound experience.', image: 'https://via.placeholder.com/300x200', price: 199.99, rating: 4 },
    { id: 16, name: 'Fitness Tracker', description: 'Monitor your health goals.', image: 'https://via.placeholder.com/300x200', price: 49.99, rating: 3 },
    { id: 17, name: 'Coffee Maker', description: 'Brew the perfect cup.', image: 'https://via.placeholder.com/300x200', price: 69.99, rating: 4 },
    { id: 18, name: 'Electric Kettle', description: 'Quick and easy boiling.', image: 'https://via.placeholder.com/300x200', price: 29.99, rating: 4 },
    { id: 19, name: 'Air Fryer', description: 'Healthier fried foods.', image: 'https://via.placeholder.com/300x200', price: 129.99, rating: 4 },
    { id: 20, name: 'Portable Charger', description: 'Power on the go.', image: 'https://via.placeholder.com/300x200', price: 19.99, rating: 4 },
  ];

  const filteredProducts = products.filter(product =>
    product.name.toLowerCase().includes(searchTerm.toLowerCase())
  );

  return (
    <div className="product-list">
      <div className="products-grid">
        {filteredProducts.length > 0 ? (
          filteredProducts.map(product => (
            <ProductCard key={product.id} {...product} />
          ))
        ) : (
          <p>No products found.</p>
        )}
      </div>
    </div>
  );
};

export default ProductList;
